import React from "react";

type TodolistType = {
    title: string
    tasks: TasksType[]
}

export type TasksType = {
    id: number
    title: string
    isDone: boolean
}


export const Todolist = ({title, tasks}: TodolistType) => {
    return (
        <div>
            <h3>{title}</h3>
            <div>
                <input/>
                <button>+</button>
            </div>
            <ul>
                {tasks.length
                    ? tasks.map(t => {
                            return (
                                <li key={t.id}>
                                    <input type="checkbox" checked={t.isDone}/>
                                    <span>{t.title}</span>
                                </li>
                            )
                        }
                    ) : <div>Todolist required</div>
                }
            </ul>
            <div>
                <button>All</button>
                <button>Active</button>
                <button>Completed</button>
            </div>
        </div>
    )
}
